import React from 'react';
import Login from './components/Login';

const App: React.FC = () => {
  return (
    <body>
      <div className="verticalCenter" style={{ height: '100vh' }}>
        <Login />
      </div>
      <section style={{ height: '30vh', display: 'flex', textAlign: 'center' }}>
        <h1> Ludis</h1>
      </section>
    </body>
  );
}

export default App;
